    gettextCatalog.setStrings('nb', {"Active subject":"Valgt emneord","All libraries":"Alle bibliotek","An unknown error occured.":"Det oppsto en ukjent feil.","Broad":"Bredt","Catalogue results":"Katalogresultater","Containing":"Inneholder","Ends with":"Slutter med","Enter a subject":"Søk etter emne","Exact match":"Eksakt lik","Failed to fetch list of editions.":"Klarte ikke hente utgaver.","Fetching more editions…":"Henter flere utgaver…","Found one document.":["Fant ett dokument","Fant {{$count}} dokumenter."],"GenreForm":"Sjanger/form","Geographic":"Sted","Grunnstoff":"Chemical element","How odd! Not a single document on that subject could be found using the current subject vocabulary.":"Så rart! Ikke et eneste dokument ble funnet ","Human rights":"Menneskerettigheter","Humanities and social sciences":"Humaniora og samfunnsfag","Humord is the best portal to the humanities and social sciences. The vocabulary also has a relatively large amount of interdisciplinary subject headings. This vocabulary has only Norwegian Bokmål terms.":"Humord gir den beste inngangen til humaniora og samfunnsfag. Vokabularet har også en stor mengde tverrfaglige termer. Dette vokabularet har bare emneord på bokmål.","Loaded {{ vm.last }} records so far, {{ vm.total_results - vm.last }} to go, hold on…":"{{ vm.last }} poster hentet så langt, {{ vm.total_results - vm.last }} gjenstår, vi skynder oss sakte…","Looking…":"Leter…","More editions":"Flere utgaver","Narrow":"Snevert","No hits :(":"Ingen treff :(","No network connection":"Ingen nettverksforbindelse","Once in, you can toggle between <em>broad</em> and <em>narrow</em> search. With <em>narrow</em> search, you will only get highly relevant results carefully indexed by skilled librarians and subject specialists using the selected vocabulary. <em>Broad</em> search will give you more results, matching subjects from other vocabularies or even keywords from a variety of sources, but sometimes at the expense of precision.":"Vel inne kan du velge mellom <em>bredt</em> og <em>snevert</em> søk. Med <em>snevert</em> søk vil du kun få relevante resultater som har blitt møysommelig indeksert av flinke bibliotekarer og fagfolk ved hjelp av det valgte vokabularet. <em>Bredt</em> søk er ikke like presist, men vil gi flere resultater ved at det også søkes mot andre vokabularer og frie nøkkelord fra en rekke kilder.","One edition:":["Én utgave:","{{$count}} utgaver:"],"Print copy at":"Trykt utgave ved","Science":"Realfag","Search for scientific concepts. <em>Realfagstermer</em> is a controlled vocabulary maintained by the science libraries at the University at Oslo and Bergen, and is the best portal to our collections. Realfagstermer is a multilingual vocabulary that can be searched in Bokmål, Nynorsk (translation in progress), English (translation in progress) and Latin (scientific names).":"Søk etter realfaglige begreper. <em>Realfagstermer</em> er et kontrollert begrep som vedlikeholdes av realfagsbibliotekene ved UiO og UiB, og gir den beste inngangen til disse samlingene. Realfagstermer er et flerspråklig vokabular der du kan søke på både bokmål, nynorsk (oversettelse i arbeid), engelsk (oversettelse i arbeid) og latin (vitenskapelige navn).","Search history":"Søkehistorie","See also:":"Se også:","Series":"Serie","Sorry, the subject \"{{subject}}\" was not found in the current vocabulary.":"Beklager, emnet «{{subject}}» ble ikke funnet i dette vokabularet.","Starting with":"Begynner med","Subject Search":"Emnesøk","Subject Search ß":"Emnesøk ß","Technology and engineering":"Teknologi og ingeniørfag","Tekord is a vocabulary created at NTNU (Norwegian University of Science and Technology). It is an especially useful search portal to Technical and Engeneering literature. This vocabulary has only Norwegian Bokmål terms.":"Tekord er et vokabular utviklet ved NTNU. Det er særlig en god søkeinngang til teknisk faglitteratur ved NTNU. Dette vokabularet har bare norske emneord.","Temporal":"Tid","The search went out in error:":"Søket gikk ut i feil","The subject was not found. It might have been deleted.":"Emnet ble ikke funnet. Det kan ha blitt slettet.","Topic":"Emne","Uh oh, some kind of server error occured.":"Det oppsto en serverfeil, vi beklager.","Used for:":"Brukt for:","Welcome to our subject search. Start by choosing a vocabulary from the list below. A vocabulary is a controlled set of subjects. Support for searching all vocabularies at the same time is not yet supported, but definitely something we would like to add in the future.":"Velkommen til emnesøket vårt. Begynn med å velge et emne-vokabular fra listen under. Et emne-vokabular er et kontrollert sett av emneord. Søk i alle vokabularer samtidig er foreløpig ikke støttet, men noe vi ønsker å få til i fremtiden.","Welcome to the new Subject Search beta. Head over <a href=\"https://github.com/scriptotek/emnesok/issues\">to GitHub</a> if you want to peek into the current state of development, report a problem or suggest an idea. If you're looking for the old Subject Search, it's <a href=\"http://app.uio.no/ub/emnesok/test/oria/\">still around</a>.":"Velkommen til beta-utgaven av det nye emnesøket. Du kan følge med på utviklingen <a href=\"https://github.com/scriptotek/emnesok/issues\">på GitHub</a>, og der kan du også melde fra om feil og foreslå forbedringer. Hvis du savner det gamle emnesøket, finner du det <a href=\"http://app.uio.no/ub/emnesok/test/oria/\">her</a>.","Yes, we have a controlled subject vocabulary just for human rights terms! Developed and maintained by the Norwegian Centre for Human Rights’ (SMR), the vocabulary has only English terms.":"Ja, vi har et eget emne-vokabular bare for menneskerettighetsterminologi! Det utvikles og vedlikeholdes av biblioteket ved Norsk senter for menneskerettigheter (SMR) og har bare termer på engelsk.","You could try expanding the search to a <a ui-sref=\"subject.search({narrow:false})\">broad search</a>.":"Prøv gjerne å utvide søket til et <a ui-sref=\"subject.search({narrow:false})\">bredt søk</a>.","You've reached the end, my friend!":"Du har nådd enden av lista."});
